CREATE PROCEDURE dbo.proc_transform_329
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_329
    SET payload = LEFT(payload, 1000) + N'|V4-329|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_329;
END
